import React from "react";
import MenuIcon from "@material-ui/icons/Menu";

const menuicon = {
  paddingRight: "10%",
  color: "blue",
};

export default function Home() {
  return (
    <>
      <MenuIcon className="menuicon" style={menuicon} />
    </>
  );
}
